values:
if you don't know what assassin is, it's simple: 
everyone pays a dollar to sign up. on a set date, everyone recieves a squirtgun and a slip of paper with someone's name on it. that's the person they have to "kill". here's the catch. you have to do it when the person is mostly alone. there can only be one witness. BUT there has to be a witness. when you kill someone, they're out of the game. and they hand you their piece of paper. their hit becomes your hit. the last person left standing gets the money and the glory. 

if you're down, the first opportunity to sign up will be the 29th at the los gatos negros show. the official begin of the game will be on the 14th at the i would set myself on fire for you show.
